import React from 'react';
import './Footer.css';
/*import logoFacebook from '../logoFacebook.png'
import logoTwitter from '../logoTwitter.png'
import logoInstagram from '../logoInsta.png'*/

const footerScrubs = [
  {
    li: "http://www.facebook.com",
    logo: "../logoFacebook.png"
  },
  {
    li: "https://twitter.com/login?lang=fr",
    logo: "../logoTwitter.png"
  },
  {
    li: "https://instagram.com",
    logo: "../logoInsta.png"
  },

  {
    home: "Home"
  },
 /* {
    home: "Selected Profil"
  }, 
  {
    home: "My Account"
  },
  {
    home: "Legal Mentions"
  },
  {
    home: "Contact Us"
  },*/
] 



const Footer = () =>(
      <footer className="footerDistributed">
        {footerScrubs.map(poulet => (

        <>
          <div className="footerRight">
            <a className="footerIcon" href={poulet.li}><img className="footerImg"src={poulet.logo}/></a>
          </div> 
          <div className="footerLeft">  
             <p className="footerLinks">  
               <a href="home"> {poulet.home} </a>
             </p>  
           </div>
           {/*<p> Scrub &copy; 2019 </p>*/}
         </>
         ) )}    
      </footer>

)   


export default Footer;
